import React, { useState, useEffect } from 'react';
import axios from 'axios';

const AdminPage = () => {
  const [birds, setBirds] = useState([]);
  const [cats, setCats] = useState([]);
  const [dogs, setDogs] = useState([]);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const [birdsRes, catsRes, dogsRes] = await Promise.all([
          axios.get('http://localhost:3000/api/birds'),
          axios.get('http://localhost:3000/api/cats'),
          axios.get('http://localhost:3000/api/dogs')
        ]);

        setBirds(birdsRes.data);
        setCats(catsRes.data);
        setDogs(dogsRes.data);
      } catch (error) {
        console.error('Error fetching data:', error);
      }
    };

    fetchData();
  }, []);

  return (
    <div>
      <h1>Admin Page</h1>

      <h2>Birds</h2>
      <table>
        <thead>
          <tr>
            <th>ID</th>
            <th>Name</th>
            <th>Species</th>
            <th>Family</th>
            <th>Habitat</th>
            <th>Place of Found</th>
            <th>Diet</th>
            <th>Description</th>
            <th>Weight (kg)</th>
            <th>Height (cm)</th>
            <th>Image</th>
          </tr>
        </thead>
        <tbody>
          {birds.map(bird => (
            <tr key={bird.id}>
              <td>{bird.id}</td>
              <td>{bird.name}</td>
              <td>{bird.species}</td>
              <td>{bird.family}</td>
              <td>{bird.habitat}</td>
              <td>{bird.place_of_found}</td>
              <td>{bird.diet}</td>
              <td>{bird.description}</td>
              <td>{bird.weight_kg}</td>
              <td>{bird.height_cm}</td>
              <td><img src={bird.image} alt={bird.name} height="100px" /></td>
            </tr>
          ))}
        </tbody>
      </table>

      <h2>Dogs</h2>
      <table>
        <thead>
          <tr>
            <th>ID</th>
            <th>Name</th>
            <th>Breed Group</th>
            <th>Size</th>
            <th>Lifespan</th>
            <th>Origin</th>
            <th>Temperament</th>
            <th>Colors</th>
            <th>Description</th>
            <th>Image</th>
          </tr>
        </thead>
        <tbody>
          {/* Similar structure for dogs */}
        </tbody>
      </table>

      <h2>Cats</h2>
      <table>
        <thead>
          <tr>
            <th>ID</th>
            <th>Name</th>
            <th>Origin</th>
            <th>Temperament</th>
            <th>Colors</th>
            <th>Description</th>
            <th>Image</th>
          </tr>
        </thead>
        <tbody>
          {/* Similar structure for cats */}
        </tbody>
      </table>
    </div>
  );
};

export default AdminPage;
